import React, { Component } from "react";
import GitConnectionForm from "./GitConnectionForm";
import { getUser } from "../services/userService";

class Profile extends Component {
  state = {
    name: "",
    id: "",
    company: "",
    location: "",
    email: "",
    bio: "",
    following: ""
  };

  componentDidMount = () => {};

  render() {
    return (
      <div className="row">
        <div className="col-6">
          <div>
            <GitConnectionForm />
          </div>
        </div>
        <div className="col-6">
          <h3>Profile Informations</h3>
        </div>
      </div>
    );
  }
}

export default Profile;
